import{_ as p}from"./plugin-vue_export-helper-c27b6911.js";import{o as _,c as e,e as t}from"./app-f1e7afee.js";const o={},c=t("<p>《三命通会》卷 九·六辛日戊戌时断</p><p>六辛日生时戊戌，印绶生身坐禄堂；</p><p>有托福人难靠祖，不通月气是平常。</p><p>辛日戊戌时，禄同印堂同居。</p><p>辛以戌为禄堂，戌上有明戊为印绶；以丙、丁为官，戌上戊土正位，丙、丁火局。</p><p>若有倚托通月气者，难为祖业。</p><p>不通，平常。</p><p>辛丑日戊戌时，刑害。</p><p>辰戌丑未，印绶，行南运，大贵。</p><p>寅巳，正官，贵。</p><p>子午卯酉，武职风宪。</p><p>辛卯日戊戌时，刑害，饕餮。</p><p>亥，卯月，木火运，五、六品贵。</p><p>辛巳日戊戌时，辰戌丑未月，印绶，文贵少病；生土厚分野，贵。</p><p>戌月，行木火运，风宪。</p><p>辛未日戊戌时，凶恶狠暴，忧伤妻子。</p><p>寅巳午戌丑月，贵。</p><p>申子辰亥，金水氵亟秀，尤贵。</p><p>一云克父母，身旺，中年富。</p><p>辛酉日戊戌时，凶刑。</p><p>巳酉丑辰戌未年月，魁元，卿、尹之命。</p><p>辛亥日戊戌时，凶狠、机谋奸猾，计较。</p><p>一云凶后发。</p><p>辛日戌时财库闭，如开须待丑辰来；月中甲丙天干透，富贵荣华不用猜。</p><p>辛日时临戊戌，五行财禄荣昌。</p><p>柱中辰、戌两相当，名曰钥匙开藏。</p><p>火水光辉发达，空亡锁闭如常。</p><p>运行财地并官乡，无破天然福相。</p>",28),r=[c];function s(n,a){return _(),e("div",null,r)}const f=p(o,[["render",s],["__file","261卷 九·六辛日戊戌时断.html.vue"]]);export{f as default};
